pragma solidity =0.8.7;
contract Visibilidade{
    int contagem = 0;
  
  
    function  incremetal()public{
      
        contagem = contagem +1;

   }
   function incrementEx()external{
       contagem = contagem +1;
   }
function decrementaltEx()private{
       contagem = contagem -1;
   }
   function incrementalPEx()internal{
       contagem = contagem +1;
   }
   function incrementalResult()public view returns(int){
       return contagem;
   }
}

